  true,\n\t\"url\": null,\n\t\"notes\": \"The Aura-OMI Daily Gridded Surface UV Irradiance
  Product (OMUVBd) is now available from the NASA Goddard Earth Sciences Data and
  Information Services Center (GES DISC) for the public access.nn(The shortname for
  this Level-3 OMI Surface UVB product is OMUVBd_V003)nnThe algorithm team consists
  of FMI scientists Drs. J. Hovila, A. Arola and J. Tamminen.nnThe OMUVBd product
  contains global erythemally weighted daily dose and erythemal dose rate at local
  solar noon at 1.0x1.0 deg grids.nnOMUVBd files are available in EOS Hierarchical
  Data Format (HDF-EOS) and TOMS-Like ASCII Format. Each file contains daily data
  from the day lit portion of the globe. The maximum file size for the OMUVBd data
  product is about 2 MBytes.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
